import APIHandler from "./APIHandler.js";

class APIAirport extends APIHandler {
  async queryAirportByIdCity(_idCity) {
    try {
      const data = await this.getRequest(
        "http://54.146.196.79:8080/dp1/api/airport/findby/city?id=" + _idCity
      );
      return data;
    } catch (error) {
      console.error(error);
    }
  }

  async queryAllAirports() {
    try {
      const data = await this.getRequest(
        "http://54.146.196.79:8080/dp1/api/airport/all" 
      );
      return data;
    } catch (error) {
      console.error(error);
    }
  }

  async queryAllFlights() {
    try {
      const data = await this.getRequest(
        "http://54.146.196.79:8080/dp1/api/airport/flight/all" 
      );
      return data;
    } catch (error) {
      console.error(error);
    }
  }

}

export default APIAirport;
